import type { Argv, CommandModule } from 'yargs';
import { isAbsolute, join } from 'node:path';
import type { MeasureArgs } from './types';
import { handler } from './handler';

export const measureCommand: CommandModule<{}, MeasureArgs> = {
  command: 'measure <commandToProfile...>',
  describe:
    'Run a Node.js script with CPU profiling enabled and save the profile to disk',
  builder: (yargs: Argv): Argv<MeasureArgs> => {
    return yargs
      .group(
        ['cpu-prof-dir', 'cpu-prof-interval', 'cpu-prof-name', 'help'],
        'CPU Measure Options:'
      )
      .option('cpu-prof-interval', {
        describe: 'Interval in milliseconds to sample the command.',
        type: 'number',
      })
      .option('cpu-prof-dir', {
        describe: 'Directory to save the profile.',
        type: 'string',
        normalize: true,
        default: join(process.cwd(), 'profiles'),
        coerce: (dir: string) => {
          return isAbsolute(dir) ? dir : join(process.cwd(), dir);
        },
      })
      .option('cpu-prof-name', {
        describe: 'Name of the profile (auto-generated if not specified).',
        type: 'string',
        normalize: true,
      })
      .option('flagMain', {
        describe:
          'Adds prefix and command args to the profile name of the initial process.',
        type: 'boolean',
        default: false,
      })
      .example(
        '$0 measure --cpu-prof-dir ./profiles node my_script.js --arg-for-script',
        'Profile `node my_script.js --arg-for-script` and save to ./profiles. Options can be anywhere.'
      )
      .example(
        '$0 measure node my_app.js --cpu-prof-name build-profile --cpu-prof-interval 500',
        'Profile `node my_app.js`, name it `build-profile` with 500ms interval. Options can be interspersed.'
      )
      .epilog(
        `The command to profile and its arguments are explicitly parsed via the command definition.
        CPU Measure options (like --cpu-prof-dir) can be placed anywhere.

        Examples:
        $0 measure node my_script.js --arg-for-script
        $0 measure --cpu-prof-dir ./custom-profiles node my_app.js
        $0 measure node my_app.js --cpu-prof-interval 100`
      );
  },
  handler,
};

import type { MeasureArgs } from './types';
import { runWithCpuProf } from '../../../lib/cpu/run-with-cpu-prof';
import { filterCliOptions } from './utils';

export async function handler(argv: MeasureArgs): Promise<void> {
  const { _: positionalArgs = [], ...options } = argv;
  const {
    $0,
    cpuProfDir,
    ['cpu-prof-dir']: cpuProfDir2,
    cpuProfInterval,
    ['cpu-prof-interval']: cpuProfInterval2,
    cpuProfName,
    ['cpu-prof-name']: cpuProfName2,
    commandToProfile,
    ['command-to-profile']: commandToProfile2,
    flagMain,
    ['flag-main']: flagMain2,
    ...commandOptions
  } = options;

  // Determine the actual command to profile
  const cmdToRun = // Case 1: Explicit 'measure' command is used.
    // Example: `cpu-prof measure npm -v`
    // Here, `commandToProfile` will be `['npm', '-v']`.
    (
      commandToProfile && commandToProfile.length > 0
        ? commandToProfile
        : // Case 2: Default command ('*') is used (i.e., 'measure' is not explicitly typed).
          // Example: `cpu-prof npm -v`
          // Here, `positionalArgs` (argv._) will be `['npm', '-v']`.
          positionalArgs
    ) as string[];

  const nodeOptions = {
    ...(cpuProfDir ? { cpuProfDir } : {}),
    ...(cpuProfInterval ? { cpuProfInterval } : {}),
    ...(cpuProfName ? { cpuProfName } : {}),
    ...(flagMain ? { flagMain } : {}),
  };

  if (!cmdToRun || !Array.isArray(cmdToRun) || cmdToRun.length === 0) {
    console.error(
      ' Error: No command or script provided to profile. Usage: measure <command_or_script.js> [args...]'
    );
    process.exit(1);
  }

  const [actualCommand, ...actualCommandArgs] = cmdToRun;

  // Filter commandOptions to prefer kebab-case and remove duplicate camelCase keys
  const filteredCommandOptions = filterCliOptions(commandOptions);

  try {
    await runWithCpuProf(
      actualCommand,
      {
        _: actualCommandArgs,
        ...filteredCommandOptions,
      },
      nodeOptions
    );
  } catch (error) {
    const e = error as Error;
    let errorMessage = e.message || 'Unknown error';

    if (errorMessage && errorMessage.includes('not allowed in NODE_OPTIONS')) {
      console.error(
        ' Error: Node.js has restricted some V8 options (like --cpu-prof) from being set via NODE_OPTIONS.\n' +
          '   This is a security feature in recent Node.js versions.\n' +
          '   The V8 option "--cpu-prof" specifically was disallowed.\n' +
          '   It works in Node.js version > 22, you can switch to it (e.g., `nvm use <version>`).\n'
      );
    } else if (errorMessage.includes('Command failed with exit code')) {
      // Generic failure from executeChildProcess, could append more details if available
      console.error(` Error during CPU profiling: ${errorMessage}.`);
    } else {
      // Other types of errors (e.g., issues within runWithCpuProf before spawning)
      console.error(` Error during CPU profiling setup: ${errorMessage}`);
    }
    process.exit(1);
  }
}

export interface MeasureArgs {
  _?: string[];
  'cpu-prof-interval'?: number;
  cpuProfInterval?: number;
  'cpu-prof-dir'?: string;
  cpuProfDir?: string;
  'cpu-prof-name'?: string;
  cpuProfName?: string;
  commandToProfile?: string;
  [key: string]: any;
}

export function filterCliOptions(
  commandOptions: Record<string, any>
): Record<string, any> {
  const filteredCommandOptions: Record<string, any> = {};
  for (const key in commandOptions) {
    if (Object.prototype.hasOwnProperty.call(commandOptions, key)) {
      // If the key is camelCase and its kebab-case version also exists, skip the camelCase version.
      // This prevents duplicate arguments like --foo-bar and --fooBar when yargs provides both.
      const kebabKey = key.replace(
        /[A-Z]/g,
        (letter) => `-${letter.toLowerCase()}`
      );
      if (key !== kebabKey && commandOptions[kebabKey] !== undefined) {
        continue;
      }
      filteredCommandOptions[key] = commandOptions[key];
    }
  }
  return filteredCommandOptions;
}

import { isAbsolute, join } from 'node:path';
import type { MergeArgs, ProcessedMergeArgs } from './types';

/**
 * Process and validate CLI arguments for the merge command
 */
export function processArgs(argv: MergeArgs): ProcessedMergeArgs {
  let { inputDir, outputDir, verbose, smosh, startTracingInBrowser } = argv;

  if (!inputDir) {
    // Should be caught by yargs due to <inputDir> being required (demandOption)
    // and builder.ts check
    throw new Error('Input directory is required and was not provided.');
  }

  const resolvedInputDir = isAbsolute(inputDir)
    ? inputDir
    : join(process.cwd(), inputDir);

  let resolvedOutputDir: string;
  if (!outputDir) {
    // If no output directory specified, use input directory
    resolvedOutputDir = resolvedInputDir;
  } else {
    // If outputDir is provided, resolve it relative to cwd if it's not absolute
    resolvedOutputDir = isAbsolute(outputDir)
      ? outputDir
      : join(process.cwd(), outputDir);
  }

  return {
    inputDir: resolvedInputDir,
    outputDir: resolvedOutputDir,
    verbose: verbose || false,
    smosh: smosh ?? false,
    startTracingInBrowser: startTracingInBrowser ?? true,
  };
}

import { mkdirSync } from 'node:fs';
import { readFile } from 'node:fs/promises';
import { join } from 'path';
import type { MergeArgs, ProcessedMergeArgs } from './types';
import { processArgs } from './args-processor';
import { mergeCpuProfileFiles } from '../../../lib/merge-cpuprofile-files';
import * as console from 'node:console';

/**
 * Handle the merge command execution
 */
export async function handler(argv: MergeArgs): Promise<void> {
  const processedArgs = processArgs(argv);

  try {
    await handleCpuProfileMerge(processedArgs);
  } catch (error) {
    console.error(
      ' Error in cpu-merge command handler:',
      (error as Error).message
    );
    process.exit(1);
  }
}

/**
 * Handle CPU profile merging (original bin.ts logic)
 */
async function handleCpuProfileMerge(
  processedArgs: ProcessedMergeArgs
): Promise<void> {
  const { inputDir, outputDir, verbose, smosh, startTracingInBrowser } =
    processedArgs;

  if (!inputDir || inputDir === '') {
    throw new Error('Input directory is required for CPU profile mode');
  }

  // Create an output directory if it doesn't exist
  mkdirSync(outputDir, { recursive: true });

  // Define the output file path inside the output directory
  const outputFilePath = join(outputDir, 'merged-profile.json');

  if (verbose) {
    console.log(` Merging CPU profile files from: ${inputDir}`);
    console.log(` Output file: ${outputFilePath}`);
    smosh && console.log(' Smosh processes for better DX');
    startTracingInBrowser &&
      console.log(` Highlight process ${startTracingInBrowser}`);
  }

  // Use the existing mergeCpuProfileFiles function with the full file path
  await mergeCpuProfileFiles(inputDir, outputFilePath, {
    smosh: smosh ? 'pid' : 'off',
    startTracingInBrowser,
  });

  // Read the created file to get statistics
  const resultContent = await readFile(outputFilePath, 'utf8');
  const resultTrace = JSON.parse(resultContent);
  const eventCount = Array.isArray(resultTrace)
    ? resultTrace.length
    : resultTrace.traceEvents?.length || 0;

  console.log(` CPU profiles merged successfully!`);
  console.log(` -  Generated ${eventCount} trace events`);
  console.log(` -  Output file: ${outputFilePath}`);
}

import type { CommandModule } from 'yargs';
import type { MergeArgs } from './types';
import { builder } from './builder';
import { handler } from './handler';

/**
 * Merge command module for yargs
 */
export const mergeCommand: CommandModule<{}, MergeArgs> = {
  command: 'merge <inputDir>',
  describe:
    'Merge multiple Chrome DevTools trace files or CPU profile files into a single file',
  builder,
  handler,
};

export default mergeCommand;

// Re-export types and utilities for external use
export type { MergeArgs, ProcessedMergeArgs } from './types';
export { processArgs } from './args-processor';

import type { ReduceTraceArgs, ProcessedArgs } from './types';

/**
 * Process and validate CLI arguments for the reduce-trace command
 * Note: Default input/output file handling is now done by yargs middleware
 */
export function processArgs(
  argv: ReduceTraceArgs,
  logger = console
): ProcessedArgs {
  // Input and output files are now handled by middleware
  const inputFile = argv.inputFile!; // Safe to assert since middleware ensures it's set
  const outputFile = argv.output!; // Safe to assert since middleware ensures it's set

  if (argv.verbose) {
    // Verbose logging is handled elsewhere - this just indicates middleware was used
    logger.log(` Using input file: ${inputFile}`);
    logger.log(` Using output file: ${outputFile}`);
  }

  return {
    inputFile,
    outputFile,
    verbose: argv.verbose || false,
    filterOptions: {
      filterNetwork: argv.network ?? true,
      filterAnimation: argv.animation ?? true,
      filterGPU: argv.gpu ?? true,
      filterThreadPool: argv.threadpool ?? true,
      filterStreamingCompile: argv.streamingcompile ?? true,
      durMin: argv['dur-min'],
      durMax: argv['dur-max'],
      tsMin: argv['ts-min'],
      tsMax: argv['ts-max'],
      includePhases: argv['include-phases'],
      excludePhases: argv['exclude-phases'],
      includePids: argv['include-pids'],
      excludePids: argv['exclude-pids'],
      includeTids: argv['include-tids'],
      excludeTids: argv['exclude-tids'],
      includeNames: argv['include-names'],
      excludeNames: argv['exclude-names'],
      includeCats: argv['include-cats'],
      excludeCats: argv['exclude-cats'],
    },
  };
}

import type { Argv } from 'yargs';
import { DEFAULT_FILTER_OPTIONS } from '../../../lib/reduce-trace';
import type { ReduceTraceArgs } from './types';
import {
  coerceStringArray,
  coerceNumberArray,
  coerceStringArrayWithDefaults,
} from '../../utils';
import { validateTraceReduceArgs } from './helpers';
import { findNewestTraceFile, generateOutputFilename } from '../../utils';

// Constants for default values to reduce duplication
const DEFAULT_DUR_MIN = DEFAULT_FILTER_OPTIONS.durMin;
const DEFAULT_EXCLUDE_NAMES =
  DEFAULT_FILTER_OPTIONS.excludeNames?.join(', ') ?? '';
const DEFAULT_EXCLUDE_CATS =
  DEFAULT_FILTER_OPTIONS.excludeCats?.join(', ') ?? '';
const DEFAULT_EXCLUDE_NAMES_COMMA =
  DEFAULT_FILTER_OPTIONS.excludeNames?.join(',') ?? '';
const DEFAULT_EXCLUDE_CATS_COMMA =
  DEFAULT_FILTER_OPTIONS.excludeCats?.join(',') ?? '';

/**
 * Add basic options (output, verbose)
 */
function addBasicOptions(yargs: Argv<ReduceTraceArgs>): Argv<ReduceTraceArgs> {
  return yargs
    .group(['help', 'version', 'verbose', 'output'], 'Basic Options:')
    .options({
      output: {
        alias: 'o',
        describe: 'Output file path',
        type: 'string',
        normalize: true,
      },
      verbose: {
        alias: 'v',
        describe: 'Enable verbose logging',
        type: 'boolean',
        default: false,
      },
    });
}

/**
 * Add event type filtering options
 */
function addEventTypeFilters(
  yargs: Argv<ReduceTraceArgs>
): Argv<ReduceTraceArgs> {
  return yargs
    .group(
      ['network', 'animation', 'gpu', 'threadpool', 'streamingcompile'],
      'Event Type Filtering:'
    )
    .options({
      network: {
        describe: 'Enable network event filtering',
        type: 'boolean',
        default: true,
      },
      animation: {
        describe: 'Enable animation event filtering',
        type: 'boolean',
        default: true,
      },
      gpu: {
        describe: 'Enable GPU event filtering',
        type: 'boolean',
        default: true,
      },
      threadpool: {
        describe: 'Enable ThreadPool event filtering',
        type: 'boolean',
        default: true,
      },
      streamingcompile: {
        describe: 'Enable StreamingCompile event filtering',
        type: 'boolean',
        default: true,
      },
    });
}

/**
 * Add advanced filtering options (phases, PIDs, TIDs)
 */
function addAdvancedFiltering(
  yargs: Argv<ReduceTraceArgs>
): Argv<ReduceTraceArgs> {
  return yargs
    .group(
      [
        'include-phases',
        'exclude-phases',
        'include-pids',
        'exclude-pids',
        'include-tids',
        'exclude-tids',
      ],
      'Advanced Filtering:'
    )
    .options({
      'include-phases': {
        describe:
          'Comma-separated list of event phases to include (e.g., B,E,X)',
        type: 'array',
        coerce: coerceStringArray,
      },
      'exclude-phases': {
        describe: 'Comma-separated list of event phases to exclude (e.g., M,I)',
        type: 'array',
        coerce: coerceStringArray,
      },
      'include-pids': {
        describe: 'Comma-separated list of Process IDs to include',
        type: 'array',
        coerce: (arg) => coerceNumberArray(arg, 'PID'),
      },
      'exclude-pids': {
        describe: 'Comma-separated list of Process IDs to exclude',
        type: 'array',
        coerce: (arg) => coerceNumberArray(arg, 'PID'),
      },
      'include-tids': {
        describe: 'Comma-separated list of Thread IDs to include',
        type: 'array',
        coerce: (arg) => coerceNumberArray(arg, 'TID'),
      },
      'exclude-tids': {
        describe: 'Comma-separated list of Thread IDs to exclude',
        type: 'array',
        coerce: (arg) => coerceNumberArray(arg, 'TID'),
      },
    });
}

/**
 * Add name and category filtering options
 */
function addNameCatFiltering(
  yargs: Argv<ReduceTraceArgs>
): Argv<ReduceTraceArgs> {
  return yargs
    .group(
      ['include-names', 'exclude-names', 'include-cats', 'exclude-cats'],
      'Name & Category Filtering:'
    )
    .options({
      'include-names': {
        describe: 'Comma-separated list of event names to include',
        type: 'array',
        coerce: coerceStringArray,
      },
      'exclude-names': {
        describe: `Comma-separated list of event names to exclude (default: ${DEFAULT_EXCLUDE_NAMES_COMMA})`,
        type: 'array',
        default: DEFAULT_FILTER_OPTIONS.excludeNames,
        coerce: (arg) =>
          coerceStringArrayWithDefaults(
            arg,
            DEFAULT_FILTER_OPTIONS.excludeNames
          ),
      },
      'include-cats': {
        describe: 'Comma-separated list of event categories to include',
        type: 'array',
        coerce: coerceStringArray,
      },
      'exclude-cats': {
        describe: `Comma-separated list of event categories to exclude (default: ${DEFAULT_EXCLUDE_CATS_COMMA})`,
        type: 'array',
        default: DEFAULT_FILTER_OPTIONS.excludeCats,
        coerce: (arg) =>
          coerceStringArrayWithDefaults(
            arg,
            DEFAULT_FILTER_OPTIONS.excludeCats
          ),
      },
    });
}

/**
 * Add duration and timestamp filtering options
 */
function addDurationTimestampFiltering(
  yargs: Argv<ReduceTraceArgs>
): Argv<ReduceTraceArgs> {
  return yargs
    .group(
      ['dur-min', 'dur-max', 'ts-min', 'ts-max'],
      'Duration & Timestamp Filtering:'
    )
    .options({
      'dur-min': {
        describe: `Filter out events shorter than specified duration in microseconds (default: ${DEFAULT_DUR_MIN}s)`,
        type: 'number',
        default: DEFAULT_FILTER_OPTIONS.durMin,
      },
      'dur-max': {
        describe:
          'Filter out events longer than specified duration in microseconds',
        type: 'number',
      },
      'ts-min': {
        describe:
          'Filter out events with timestamp earlier than specified in microseconds',
        type: 'number',
      },
      'ts-max': {
        describe:
          'Filter out events with timestamp later than specified in microseconds',
        type: 'number',
      },
    });
}

/**
 * Build the yargs command configuration for reduce-trace
 */
export function builder(yargs: Argv): Argv<ReduceTraceArgs> {
  return [
    addBasicOptions,
    addEventTypeFilters,
    addAdvancedFiltering,
    addNameCatFiltering,
    addDurationTimestampFiltering,
  ]
    .reduce((acc, fn) => fn(acc), yargs)
    .positional('inputFile', {
      describe: 'Path to the input trace file (JSON format)',
      type: 'string',
      normalize: true,
    })
    .example(
      '$0 trace-reduce trace.json',
      'Reduce trace.json with default filters'
    )
    .example(
      '$0 trace-reduce trace.json -o cleaned.json -v',
      'Reduce with custom output and verbose logging'
    )
    .example(
      '$0 trace-reduce --no-network --no-gpu trace.json',
      'Reduce keeping network and GPU events'
    )
    .example(
      '$0 trace-reduce --include-cats blink,v8 trace.json',
      'Include only blink and v8 categories'
    )
    .example(
      '$0 trace-reduce --dur-min 1000 --dur-max 50000 trace.json',
      'Filter by duration range'
    )
    .epilog(
      `
Default Behavior:
   Network, animation, GPU, ThreadPool, StreamingCompile filtering: enabled
   v8.compile category filtering: enabled  
   Minimum duration filtering: ${DEFAULT_DUR_MIN}s
   Default excluded names: ${DEFAULT_EXCLUDE_NAMES}
   If no input file provided, uses newest .json file from ./packages/cpu-prof/mocks/fixtures/
   If no output file specified, adds .reduced.json to the input filename
   Use --no-<option> to disable any boolean filter (e.g., --no-network, --no-animation)
   Use --no-dur-min to disable minimum duration filtering
    `
    )
    .conflicts('include-phases', 'exclude-phases')
    .conflicts('include-pids', 'exclude-pids')
    .conflicts('include-tids', 'exclude-tids')
    .conflicts('include-names', 'exclude-names')
    .conflicts('include-cats', 'exclude-cats')
    .middleware((argv) => {
      // Handle input file (auto-select if not provided)
      if (!argv.inputFile) {
        argv.inputFile = findNewestTraceFile();
      }

      // Handle output file (auto-generate if not provided)
      if (!argv.output) {
        argv.output = generateOutputFilename(argv.inputFile);
      }
    })
    .check(validateTraceReduceArgs);
}

